import React, { Fragment } from 'react';
import '../dashboard.css';
import { url } from '../../../config';

const Navbar = () => {
    return (
        <Fragment>
            <div className="navbar" >

                <img src={`${url}/uploads/category-icons/hops-active.png`} alt="Hops" className="logo-img" />
                <a href="" className="">Dashboard</a>

                <ul className="">
                    <li className="nav-item">
                        <a href="" className="nav-link">RECIPES</a>
                    </li>
                    <li className="nav-item ">
                        <a href="" className="nav-link">BEERS</a>
                    </li>
                    <li className="nav-item">
                        <a href="" className="nav-link">LOG OUT</a>
                    </li>
                </ul>
            </div>
        </Fragment>
    )
}

export default Navbar;
